INSERT INTO `person` (`personID`, `first`, `middle`, `last`, `maiden`, `nickname`, `face`, `siblingSeq`, `KeemBool`, `HusbandBool`, `KemlerBool`, `KaplanBool`, `interests`, `education`, `work`, `notes1`, `notes2`, `notes3`, `birthdate`, `birthplace`, `deathdate`, `Gender`, `origin`, `firstFamily`, `currentLocation`, `adoptedBool`, `directBool`, `hideBool`, `lastModified`, `flag1`, `flag2`) VALUES (199, 'Grace', '', 'Alderman', 'Fitzpatrick', '', '', 0, 0, 1, 0, 0, '                                                                                                                                                                  ', '                                                                                                                                                             ', 'Clerk (1892 NY census)                                                                                                                                                  ', '18 and living at home in 1880, 20 and married (to Mr Manning) in 1882, 21 and has Sadie in 1883, 1892 NY state census has her living alone in Buffalo as a clerk.                                    ', '1900 census: Sadie lives with grandparents, and census has a record for widow Grace C Manning born Dec 1864, working as a cook for the Howard family in Niagara, but she lists both parents as born in NY and the father of our Grace was born in Ireland     ', 'She married Fred Alderman around 1900, lives with him in 1910 census (second marriage), and she is a widow with roomers in the 1930 census.                         ', '1862', 'New York', '', 'F', '3/4 Irish, 1/4 English', 62, '', 0, 0, 0, '2010-11-20 17:58:40', '', '');
