INSERT INTO `person` (`personID`, `first`, `middle`, `last`, `maiden`, `nickname`, `face`, `siblingSeq`, `KeemBool`, `HusbandBool`, `KemlerBool`, `KaplanBool`, `interests`, `education`, `work`, `notes1`, `notes2`, `notes3`, `birthdate`, `birthplace`, `deathdate`, `Gender`, `origin`, `firstFamily`, `currentLocation`, `adoptedBool`, `directBool`, `hideBool`, `lastModified`, `flag1`, `flag2`) VALUES (201, 'William', '', 'Fitzpatrick', '', '', '', 0, 0, 1, 0, 0, '                                                                                                                                                ', '                                                                                                                                                ', 'Sailor (from 1880 census) ', 'The 1900 census gives William''s immigration year as 1847, and Buffalo Immigration Records do too. May have arrived in NYC from Liverpool on the ship Queen Of The West on April 12, 1847. He took the oath of naturalization April 20, 1865.               ', 'Died Dec 18, 1908, at the home of his daughter Mrs. William A Tibby, No 1530 Michigan Ave. Aged 82 yrs.Source: http://familytreemaker.genealogy.com/users/f/i/t/W-Daniel-Fitzpatrick/WEBSITE-0001/UHP-0396.html', 'From wfitzpat119 ancestry.com tree, he''s buried at Holy Cross cemetery, Lakawanna, N.Y. Plot 4, Sect J, Lot 73            ', '5/1832', 'Ireland', '12/17/1908', 'M', 'Irish', 0, '', 0, 0, 0, '2012-01-15 10:18:09', '', '');
