INSERT INTO `person` (`personID`, `first`, `middle`, `last`, `maiden`, `nickname`, `face`, `siblingSeq`, `KeemBool`, `HusbandBool`, `KemlerBool`, `KaplanBool`, `interests`, `education`, `work`, `notes1`, `notes2`, `notes3`, `birthdate`, `birthplace`, `deathdate`, `Gender`, `origin`, `firstFamily`, `currentLocation`, `adoptedBool`, `directBool`, `hideBool`, `lastModified`, `flag1`, `flag2`) VALUES (237, 'Martin J', '', 'Keem', '', '', '', 0, 1, 0, 0, 0, '                                                                                                            ', '                                                                                                            ', 'Farmer, and he worked on the Erie Canal as a foreman and he employed 13 hired men.                                                                                                            ', 'Came to America from Alsace Lorraine in 1834. After working on the erie canal where he sustained a fractured leg he came to willink (East Aurora) and was employed by the Elder Hamlin, Father of C.J. Hamlin and came to Sheldon in 1836 and was employed as ', 'foreman by Dr. Ziba Hamillton for a period of 4 years to manage his large holdings. He then went to farming for himself and soon bought a farm in wales, Erie County, NY which became known as the \"Keem homestead\".                         ', 'The 1850 census has them as the Keim family.  Burial: St. Cecilia RC Cem., Sheldon, NY                                                            ', '1/16/1811', 'Gunstett, Alsace', '1900', 'M', 'French', 132, '', 0, 1, 0, '2012-01-26 21:46:18', '', '');
